import { useEffect, useState } from "react";
import { useParams } from "react-router-dom";

const SingleGame = () => {

    let param = useParams();

    const [game, setGame] = useState({});

    useEffect(
        () => {
            fetch("http://localhost:8081/videogame/" + param.id)
            .then(response => response.json())
            .then(responseJSON => setGame(responseJSON))
        }, []
    )

    return (
        <div>
            {game.videogameId}
        </div>
    )

}

export default SingleGame;
